import React, { useEffect, useState } from "react";
import axios from "axios";
import { jwtDecode } from "jwt-decode";
// import { createConsumer } from "@rails/actioncable";
import { useParams } from "react-router-dom";
import Navbar from "../components/NavBar";

import "./ChatPage.css"; // Import styles

const ChatPage = () => {
  const { requesterId, volunteerId } = useParams(); // Get IDs from the URL
  const [user, setUser] = useState(null);
  const [volunteers, setVolunteers] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);
  const [deeds, setDeeds] = useState([]);

  // const [messages, setMessages] = useState([]);
  // const [newMessage, setNewMessage] = useState("");
  const token = localStorage.getItem("token");
  // const navigate = useNavigate();

  useEffect(() => {
    if (token) {
      const decodedToken = jwtDecode(token);
      fetchUserDetails(decodedToken.user_id);
      fetchDeeds(decodedToken.user_id);
    }
  }, [token, selectedUser]);

  // Fetch the logged-in user's details
  const fetchUserDetails = async (userId) => {
    if (!userId) return;
    try {
      const response = await axios.get(`http://localhost:3000/users/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUser(response.data);
    } catch (error) {
      console.error("Error fetching user details:", error);
    }
  };

  // Fetch deeds for the logged-in user
  const fetchDeeds = async (userId) => {
    try {
      const response = await axios.get(`http://localhost:3000/users/${userId}/deeds`, {
        headers: { Authorization: `Bearer ${token}` },
      });

      setDeeds(response.data);
      const volunteeredResponse = await axios.get(`http://localhost:3000/users/${userId}/volunteered_deeds`, {
        headers: { Authorization: `Bearer ${token}` },
      });

      setVolunteers(volunteeredResponse.data);
    } catch (error) {
      console.error("Error fetching deeds:", error);
    }
  };

  // Setup WebSocket for real-time chat updates
  // const setupChatWebSocket = () => {
  //   const cable = createConsumer("ws://localhost:3000/cable");
  //   cable.subscriptions.create(
  //     { channel: "ChatRoomChannel", requester_id: requesterId, volunteer_id: volunteerId },
  //     {
  //       received: (data) => {
  //         setMessages((prevMessages) => [...prevMessages, data.message]);
  //       },
  //     }
  //   );
  // };

  // Fetch chat messages between requester and volunteer
  // const fetchMessages = async (otherUserId) => {
  //   try {
  //     const response = await axios.get(`http://localhost:3000/chat_rooms/${requesterId}/${otherUserId}`, {
  //       headers: { Authorization: `Bearer ${token}` },
  //     });
  //     setMessages(response.data.messages);
  //     setSelectedUser(otherUserId);
  //   } catch (error) {
  //     console.error("Error fetching messages:", error);
  //   }
  // };

  // Send a new message
  // const sendMessage = async () => {
  //   if (!newMessage.trim()) return;

  //   try {
  //     const response = await axios.post(
  //       `http://localhost:3000/chat_rooms/${requesterId}/${selectedUser}/messages`,
  //       { content: newMessage },
  //       { headers: { Authorization: `Bearer ${token}` } }
  //     );

  //     setMessages((prevMessages) => [...prevMessages, response.data]);
  //     setNewMessage("");
  //   } catch (error) {
  //     console.error("Error sending message:", error);
  //   }
  // };

  return (
    <div className="chat-container">
      <Navbar />
      <div className="chat-content">
        {/* Left Column - User Info & Volunteers */}
        <div className="left-column">
          {user && (
            <div className="user-info">
              <h2>{user.first_name} {user.last_name}</h2>
              <p>Email: {user.email}</p>
            </div>
          )}
          <h3>Volunteers for Your Deeds</h3>
          <ul className="volunteer-list">
            {deeds.volunteers.length > 0 ? (
              volunteers.map((volunteer) => (
                <li
                  key={volunteer.id}
                  // onClick={() => fetchMessages(volunteer.id)}
                  className={`volunteer-item ${selectedUser === volunteer.id ? "selected" : ""}`}
                >
                  {volunteer.first_name} {volunteer.last_name}
                </li>
              ))
            ) : (
              <p>No volunteers yet.</p>
            )}
          </ul>
        </div>

        {/* Right Column - Chat Messages */}
        <div className="right-column">
          {selectedUser ? (
            <>
              <h3>Chat with {volunteers.find((v) => v.id === selectedUser)?.first_name}</h3>
              <div className="messages-container">
                {/* {messages.map((msg, index) => (
                  <div key={index} className={`message ${msg.sender_id === user.id ? "sent" : "received"}`}>
                    <p>{msg.content}</p>
                  </div>
                ))} */}
              </div>
              <div className="message-input">
                <input
                  type="text"
                  placeholder="Type a message..."
                  // value={newMessage}
                  // onChange={(e) => setNewMessage(e.target.value)}
                />
                <button>Send</button>
              </div>
            </>
          ) : (
            <p>Select a volunteer to start chatting.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default ChatPage;
